import React from 'react';
import { useNavigate } from 'react-router-dom';
import Button from '@mui/material/Button';
import cesar from './assets/cesar.png'

const TiposCifrado = () => {
    const navigate = useNavigate();

    return (
        <div className="tipos-cifrado-container">
            <h1>Elige un tipo de Cifrado</h1>
            <img src={cesar} alt="Cifrado César" style={{ width: '200px', height: 'auto' }} />
            <div className="buttons-container">
                
                <Button
                    variant="contained"
                    color="primary"
                    onClick={() => navigate('/cesar')}
                    className="cifrado-button"
                >
                    Cifrado César
                </Button>
                
                <Button
                    variant="contained"
                    color="secondary"
                    onClick={() => navigate('/escitala')}
                    className="cifrado-button"
                >
                    Cifrado Escítala
                </Button>
            </div>
        </div>
    );
};

export default TiposCifrado;
